import React, { useState } from 'react'

function Todo() {
    const[count, setCount] = useState(0);

    return (
        <>
                <div block="Todo" elem="Box">
                    <button 
                        onClick={
                            () => {
                                setCount(count + 2)
                            }
                        }
                    >
                        count {count}
                    </button>
                </div>
        </>
    );
}

export default Todo;
